window.addEventListener("load",()=>{const e=document.querySelectorAll(".update-trick-video-modal"),t=document.getElementById("modal-video"),d=document.getElementById("trick_video_form_trickId"),o=document.getElementById("trick_video_form_oldVideo"),n=document.getElementById("confirm-modal-update-video"),i=document.getElementById("confirm-yes-update-video"),l=document.getElementById("confirm-no-update-video"),r=document.getElementById("mobileMediasModal");let a=null;e.forEach(e=>{e.addEventListener("click",i=>{a=e.getAttribute("data-url"),r.style.setProperty("display","none","important");const l=e.getAttribute("data-video-url");t.src=l,o.value=l,d.value=e.getAttribute("data-trick-id"),n.style.setProperty("display","block","important")})}),l.addEventListener("click",()=>{n.style.setProperty("display","none","important"),location.href=a}),i.addEventListener("click",()=>{n.style.setProperty("display","none","important")})});